import React from 'react';




class CheckOut extends React.Component{
    render(){
        return(
            <div>
                <form>
                <label htmlFor='nome'>
                    Nome
                    <input
                    data-testid="checkout-fullname"
                    type='text'
                    />
                </label>
                </form>
            </div>
        )
    }
}

export default CheckOut
